import React from "react";
import {useState, useEffect} from "react";

const Main = () => {
    const [pname, setpname] = useState("");
    const [pNIC, setpNIC] = useState("");
    const [page, setpage] = useState("");
    const [pemail, setpemail] = useState("");
    const [pdata, setpdata] = useState([]);
    console.log(pdata);
    // useEffect(() => {
    //     console.log("Updated pdata:", pdata);
    // }, [pdata]);
    return (
        <div>
            <h1>OPD Booking service</h1>
            <form>
                <p>
                    Name:{"  "}
                    <input
                        type="text"
                        placeholder="type your name"
                        value={pname}
                        onChange={(e) => {
                            e.preventDefault();
                            setpname(e.target.value);
                        }}
                    />
                </p>
                <p>
                    NIC:{"  "}
                    <input
                        type="text"
                        placeholder="type your NIC num"
                        value={pNIC}
                        onChange={(e) => {
                            e.preventDefault();
                            setpNIC(e.target.value);
                        }}
                    />
                </p>
                <p>
                    age:{"  "}
                    <input
                        type="text"
                        placeholder="type your age"
                        value={page}
                        onChange={(e) => {
                            e.preventDefault();
                            setpage(e.target.value);
                        }}
                    />
                </p>
                <p>
                    email:{"  "}
                    <input
                        type="text"
                        placeholder="type your email"
                        value={pemail}
                        onChange={(e) => {
                            e.preventDefault();
                            setpemail(e.target.value);
                        }}
                    />
                </p>
                <button
                    onClick={(e) => {
                        e.preventDefault();
                        setpdata((pre) => {
                            return [
                                ...pre,
                                {
                                    pname: pname,
                                    pNIC: pNIC,
                                    page: page,
                                    pemail: pemail,
                                },
                            ];
                        });
                        setpname((pre) => {
                            if (pre.length > 0) {
                                return "";
                            } else {
                                return pre;
                            }
                        });
                    }}
                >
                    submit
                </button>

                <h2>{pname}</h2>
                <h2>{pNIC}</h2>
                <h2>{page}</h2>
                <h2>{pemail}</h2>
            </form>
        </div>
    );
};

export default Main;
